(function() {
  var STATS_NAME, STATS_VERSION, versions;

  STATS_NAME = "stats";

  STATS_VERSION = "0.0.5";

  module.exports = versions = {};

  Object.keys(process.versions).forEach(function(name) {
    return versions[name] = function(cb) {
      return cb(null, process.versions[name]);
    };
  });

  versions[STATS_NAME] = function(cb) {
    return cb(null, STATS_VERSION);
  };

}).call(this);
